INSERT INTO `posts` VALUES (2, 6, 'https://kenh14cdn.com/thumb_w/660/2018/9/16/hoa-hau-viet-nam-bui-phuong-ng-6312-3243-1534144115-15371155360221452318330.jpg', 'Loạt ảnh đời thường xinh ngất ngây của người đẹp gây tiếc nuối nhất HHVN 2018 - Á hậu Bùi Phương Nga', 'Được kỳ vọng sẽ đăng quang ngôi vị cao nhất cuộc thi Hoa hậu Việt Nam 2018 khi sở hữu nhan sắc vô cùng nổi bật, do đó việc Bùi Phương Nga chỉ dừng chân ở vị trí Á hậu 1 khiến nhiều người không khỏi tiếc nuối.', 'Tối 16/9, chung kết Hoa hậu Việt Nam 2018 chính thức diễn ra tại nhà thi đấu Phú Thọ, TP.HCM. Trải qua các phần thi trình diễn trang phục áo dài, bikini và dạ hội, Top 3 người đẹp đăng quang ngôi vị cao nhất đã chính thức lộ diện. Cụ thể, Trần Tiểu Vy đoạt vương miện danh giá, Bùi Phương Nga đạt Á hậu 1, Nguyễn Thuý An dừng chân ở vị trí Á hậu 2. \n\nÁ hậu Bùi Phương Nga - Hoa hậu Việt Nam 2018: Ảnh đời thường xinh đẹp- Ảnh 1.\nTop 3 Hoa hậu Việt Nam 2018.\n\nTrong Top 3 cuộc thi năm nay, Bùi Phương Nga là gương mặt gây tiếc nuối nhất khi chỉ đăng quang ngôi vị Á hậu 1. Sở hữu nhan sắc vô cùng nổi bật và hình thể quyến rũ, Phương Nga luôn nằm trong số những thí sinh sáng giá nhất Hoa hậu Việt Nam 2018. Thậm chí trong suốt hơn 2 tiếng diễn ra đêm Chung kết, Bùi Phương Nga liên tục được cộng đồng mạng gọi tên cho ngôi vị Hoa hậu. Ít ai biết, không chỉ sở hữu ngoại hình xinh đẹp, Bùi Phương Nga còn là \"con ngoan trò giỏi\" với thành tích 12 năm học sinh giỏi, 12 năm phổ thông và lên đại học cũng là cán bộ lớp cần mẫn. Hiện tại, Á hậu Việt Nam 2018 đang học năm 2 chuyên ngành Tài chính, ĐH Kinh tế quốc dân.', 'kenh14', 0);
